class Map{
	constructor(map){
		this.map = map;
	}
	getTile(layer, col, row) {
        return this.layers[layer][row * map.cols + col];
    }
    setTile(layer, col, row, value){
		this.layers[layer][row * map.cols + col] = value; 
    }
	
    isItem(left, right, top, bottom){
		var col1 = Math.floor(left / this.tsize);
		var row1 = Math.floor(top / this.tsize);
		var col2 = Math.floor(right / this.tsize);
		var row2 = Math.floor(top / this.tsize);
		var col3 = Math.floor(right / this.tsize);
		var row3 = Math.floor(bottom/ this.tsize);
		var col4 = Math.floor(left / this.tsize);
		var row4 = Math.floor(bottom / this.tsize);
        
        // tiles 3 and 5 are solid -- the rest are walkable
        // loop through all layers and return TRUE if any tile is solid
        for(var layer = 0; layer < map.layers.length; layer ++){
			for(var col = 0; col < map.cols; col++){
				for(var row = 0; row < map.rows; row++){
					var tile = map.getTile(layer, col, row);
					if(tile >= 20 && tile <= 40){
						if((col1 === col && row1 === row) || (col2 === col && row2 === row) || (col3 === col && row3 === row) || (col4 === col && row4 === row) ){
							return [layer, col, row, tile];
						}
					}
				}
			}
		}
	}
   isSolidTileAtXY(x, y) {
        var col = Math.floor(x / this.tsize);
        var row = Math.floor(y / this.tsize);

        // tiles 1 and 5 are 2 -- the rest are walkable
        // loop through all layers and return TRUE if any tile is solid
        return this.layers.reduce(function (res, layer, index) {
            var tile = this.getTile(index, col, row);
            var isSolid = tile === 1 || tile === 2;
            return res || isSolid;
        }.bind(this), false);
    }
    getCol(x) {
        return Math.floor(x / this.tsize);
    }
    getRown(y) {
        return Math.floor(y / this.tsize);
    }
    getX(col) {
        return col * this.tsize;
    }
    getY(row) {
        return row * this.tsize;
    }
}

